import React, { Component } from 'react';
import './Header.css';
import { Link } from 'react-router-dom';



 class AltHeader extends Component {
    render() {
        return (
            <header className='AltHeader'>
            <h>Bu poje       
           
 <Link to={{pathname: '/anasayfa'} }  className='AltHeader'> 
           Emre Can TURAL
 </Link> tarafından yapılmıştır. TÜBİTAK BİLGEM YTE-2019</h>     </header>
        )
    }
}
export default AltHeader;
